using Microsoft.AspNetCore.Mvc;
using System;
using System.IO;

namespace PdfAValidatorWebApi.Controllers
{
    /// <summary>
    /// test
    /// </summary>
    [Produces("application/json")]
    [Route("api/[controller]")]
    [ApiController]
    public class PdfAValidatorController : ControllerBase
    {
        /// <summary>
        /// Validates the compliance of a PdfA.
        /// </summary>
        /// <remarks>
        /// Sample request:
        ///
        ///     POST /Validate
        ///     {
        ///        ""
        ///     }
        ///
        /// </remarks>
        /// <param name="pdfBlob"></param>
        /// <returns>Compliance</returns>
        /// <response code="201">Returns the reuslt</response>
        /// <response code="400">If the item is null, not base64, or you missed the quotes arround it</response>
        [HttpPost]
        [ProducesResponseType(201)]
        [ProducesResponseType(400)]
        public ActionResult<bool> Validate(byte[] pdfBlob)
        {
            using (var pdfAValidator = new PdfAValidator.PdfAValidator())
            {
                var tempPdfFilePath = Path.Combine(Path.GetTempPath(), "VeraPdf" + Guid.NewGuid() + ".pdf");

                try
                {
                    System.IO.File.WriteAllBytes(tempPdfFilePath, pdfBlob);
                    var result = pdfAValidator.Validate(tempPdfFilePath);
                    return result;
                }
                finally
                {
                    System.IO.File.Delete(tempPdfFilePath);
                }
            }
        }

        /// <summary>
        /// Validates the compliance of a PdfA.
        /// </summary>
        /// <remarks>
        /// Sample request:
        ///
        ///     POST /ValidateWithDetailedReport
        ///     {
        ///        ""
        ///     }
        ///
        /// </remarks>
        /// <param name="pdfBlob"></param>
        /// <returns>Compliance</returns>
        /// <response code="201">Returns the a report about the missed complicen rules</response>
        /// <response code="400">If the item is null, not base64, or you missed the quotes arround it</response>
        [HttpPost]
        [Route("DetailedReport")]
        [ProducesResponseType(201)]
        [ProducesResponseType(400)]
        public ActionResult<report> ValidateWithDetailedReport(byte[] pdfBlob)
        {
            using (var pdfAValidator = new PdfAValidator.PdfAValidator())
            {
                var tempPdfFilePath = Path.Combine(Path.GetTempPath(), "VeraPdf" + Guid.NewGuid() + ".pdf");

                try
                {
                    System.IO.File.WriteAllBytes(tempPdfFilePath, pdfBlob);
                    var result = pdfAValidator.ValidateWithDetailedReport(tempPdfFilePath);
                    return result;
                }
                finally
                {
                    System.IO.File.Delete(tempPdfFilePath);
                }
            }
        }
    }
}